import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexDirection: "column",
  },
  header: {
    height: "10%",
    width: "100%",
  },
  homePage: {
    height: "auto",
    width: "100%",
  },
  bottom: {
    minHeight: "10%",
    height: "auto",
    maxHeight: "50rem",
    width: "100%",
    backgroundColor: theme.palette.primary.main,
  },
}));

export default useStyles;
